import React, { useState } from 'react';
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Button from "react-bootstrap/Button";
import Clock from 'react-digital-clock';
import ReactDOM from 'react-dom';                                                   
// import Card from './List';
// import Para from './Para';
// import Apps from './Apps';
// import Cunt from './cunt';
 import ImgMediaCard from './Card';
import Form from 'react-bootstrap/Form';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';


 ReactDOM.render(  <>

 <React.Fragment >
<h1 className='text-capitalize col-10 m-5 text-center text-danger' >welcome to my pC</h1>
<div className="card">
  <div className="card-body">
<div className="card" style="width: 18rem;">
  <img src="https://picsum.photos/id/237/200/301" className="card-img-top" alt="..."/>
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>  </div>
</div>
<div className="card">
  <div className="card-body">
<div className="card" style="width: 18rem;">
  <img src="https://picsum.photos/id/237/200/299" className="card-img-top" alt="..."/>
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>  </div>
</div>
<div className="card">
  <div className="card-body">
<div className="card" style="width: 18rem;">
  <img src="https://picsum.photos/id/237/200/300.5" className="card-img-top" alt="..."/>
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.
    </p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>  </div>
</div>
 </React.Fragment>

  </>
  , document.getElementById('root')
